import { useContext } from "react";
import DataContext from "./Store/auth-context";
const Showingdata =(props)=>{
    const Ctx = useContext(DataContext)
    return(
        <>
            {
                Ctx.items.map((ele,item)=>(
                    <div>
                        {ele}
                    </div>
                ))
            }
        </>
    )
}
export default Showingdata
